import { Component } from "@angular/core";



@Component({
  
    selector: "app-root",
    templateUrl:"app.component.html"
})


export class AppComponent{
  title: string="ברוכים הבאים"
 
  date!:string;
  time(){
    this.date=new Date().toString();
    
  }
}
